description:
The latest (and probably the last) official Quake III Arena Point-Release 1.32-b for Linux (released Oct.7.2002)

Use this Point-Release to install the original Quake 3 Arena on a Linux System.

The official download from the idsoftware.com ftp is often limited to ~20 KB/s
so i thought an alternative download would be great...

